import React, { useState, useEffect } from 'react';
import './Contact.css';

function Contact() {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    message: ''
  });
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [submitMessage, setSubmitMessage] = useState(null);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);
    setSubmitMessage({
      type: 'success',
      text: 'Sending your message...'
    });

    try {
      const response = await fetch('https://formspree.io/f/myzgajlb', {
        method: 'POST',
        body: JSON.stringify(formData),
        headers: {
          'Content-Type': 'application/json'
        }
      });

      if (response.ok) {
        setSubmitMessage({
          type: 'success',
          text: 'Thank you for your message. We\'ll get back to you soon!'
        });
        setFormData({ name: '', email: '', message: '' });
      } else {
        setSubmitMessage({
          type: 'error',
          text: 'Oops! Something went wrong. Please try again later.'
        });
      }
    } catch (error) {
      console.error('Error:', error);
      setSubmitMessage({
        type: 'error',
        text: 'Oops! Something went wrong. Please try again later.'
      });
    }

    setIsSubmitting(false);
  };

  useEffect(() => {
    let timer;
    if (submitMessage) {
      timer = setTimeout(() => {
        setSubmitMessage(null);
      }, 5000);
    }
    return () => clearTimeout(timer);
  }, [submitMessage]);

  const dismissMessage = () => {
    setSubmitMessage(null);
  };

  return (
    <div className="contact fade-in">
      <div className="contact-card">
        <h1><i className="fas fa-envelope"></i> Get in Touch</h1>
        <p className="tagline">Say Hi & Let's Grab a Coffee</p>

        <div className="contact-content">
          <form className="contact-form" onSubmit={handleSubmit}>
            <div className="form-group">
              <label htmlFor="name">Name</label>
              <input
                type="text"
                id="name"
                name="name"
                value={formData.name}
                onChange={handleChange}
                required
                placeholder="Your Name"
              />
            </div>
            <div className="form-group">
              <label htmlFor="email">Email</label>
              <input
                type="email"
                id="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                required
                placeholder="your.email@example.com"
              />
            </div>
            <div className="form-group">
              <label htmlFor="message">Message</label>
              <textarea
                id="message"
                name="message"
                value={formData.message}
                onChange={handleChange}
                required
                placeholder="How can I help you?"
              ></textarea>
            </div>
            <button type="submit" className="submit-btn" disabled={isSubmitting}>
              {isSubmitting ? 'Sending...' : 'Send Message'}
            </button>
          </form>

          {submitMessage && (
            <div className="terminal-overlay">
              <div className="terminal-window">
                <div className="terminal-header">
                  <div className="terminal-button red"></div>
                  <div className="terminal-button yellow"></div>
                  <div className="terminal-button green"></div>
                  <button className="terminal-close" onClick={dismissMessage}>&times;</button>
                </div>
                <div className="terminal-content">
                  <p className={`terminal-text ${submitMessage.type}`}>
                    <span className="terminal-prompt">$</span>
                    {submitMessage.type === 'success' ? 'echo "✓ ' : 'echo "✗ '}
                    {submitMessage.text}"`
                  </p>
                  <span className="terminal-cursor"></span>
                </div>
              </div>
            </div>
          )}

          <div className="contact-info">
            <h2>Connect With Me</h2>
            <p>You're welcome to reach out through any of these channels:</p>
            <div className="social-links">
              <a href="https://linkedin.com/in/sharfi" target="_blank" rel="noopener noreferrer" aria-label="LinkedIn"><i className="fab fa-linkedin"></i></a>
              <a href="https://twitter.com/sharfi__" target="_blank" rel="noopener noreferrer" aria-label="Twitter"><i className="fab fa-twitter"></i></a>
              <a href="mailto:sharfiahmed@gmail.com" aria-label="Email"><i className="fas fa-envelope"></i></a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Contact;
